MusicInfo musicInfoFromJson(String str) => MusicInfo.fromJson(json.decode(str));
String musicInfoToJson(MusicInfo data) => json.encode(data.toJson());
class MusicInfo {
  MusicInfo({
      String? id, 
      String? title, 
      String? play, 
      String? cover, 
      String? author, 
      bool? original, 
      num? duration, 
      String? album,}){
    _id = id;
    _title = title;
    _play = play;
    _cover = cover;
    _author = author;
    _original = original;
    _duration = duration;
    _album = album;
}

  MusicInfo.fromJson(dynamic json) {
    _id = json['id'];
    _title = json['title'];
    _play = json['play'];
    _cover = json['cover'];
    _author = json['author'];
    _original = json['original'];
    _duration = json['duration'];
    _album = json['album'];
  }
  String? _id;
  String? _title;
  String? _play;
  String? _cover;
  String? _author;
  bool? _original;
  num? _duration;
  String? _album;

  String? get id => _id;
  String? get title => _title;
  String? get play => _play;
  String? get cover => _cover;
  String? get author => _author;
  bool? get original => _original;
  num? get duration => _duration;
  String? get album => _album;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['id'] = _id;
    map['title'] = _title;
    map['play'] = _play;
    map['cover'] = _cover;
    map['author'] = _author;
    map['original'] = _original;
    map['duration'] = _duration;
    map['album'] = _album;
    return map;
  }

}